import React from 'react';
import StorePicker from './StorePicker';
import { BrowserRouter, Route, Switch } from 'react-router-dom';


const Router = () => (
  <BrowserRouter>
    <Switch>
      <Route exact path ="/" component={BrowserRouter}/>
    </Switch>
  </BrowserRouter>
)

export default Router;
